import React from 'react';

const Team: React.FC = () => {
    const teamMembers = [
        { name: 'Alice Johnson', role: 'Lead Researcher', expertise: 'Artificial Intelligence' },
        { name: 'Bob Smith', role: 'Data Scientist', expertise: 'Machine Learning' },
        { name: 'Charlie Brown', role: 'Software Engineer', expertise: 'Web Development' },
        { name: 'Diana Prince', role: 'Project Manager', expertise: 'Agile Methodologies' },
    ];

    return (
        <section id="team" className="team-section">
            <h2>Meet Our Team</h2>
            <div className="team-members">
                {teamMembers.map((member, index) => (
                    <div key={index} className="team-member">
                        <h3>{member.name}</h3>
                        <p><strong>Role:</strong> {member.role}</p>
                        <p><strong>Expertise:</strong> {member.expertise}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Team;
